DROP DATABASE IF EXISTS YELP;
CREATE DATABASE YELP;
USE YELP;
DROP TABLE IF EXISTS reviews;
DROP TABLE IF EXISTS users;
DROP TABLE IF EXISTS businesses;
DROP TABLE IF EXISTS photos;
CREATE TABLE users (
  ID VARCHAR(255),
  -- UNIQUE USER ID
  NAME VARCHAR(100),
  -- USER'S NAME
  TOWNLOC VARCHAR(255),
  -- TOWN-LEVEL LOCATION OF REVIEWER
  FRIENDS INT,
  -- NUMBER OF FRIENDS
  REVIEWS INT,
  -- NUMBER OF REVIEWS CREATED
  PHOTOS INT,
  -- NUMBER OF PHOTOS POSTED
  PHOTO_ID VARCHAR(100),
  -- UNIQUE IDENTIFIER OF USER'S AVATAR IMAGE
  PRIMARY KEY (ID)
);
CREATE TABLE businesses (
  ID VARCHAR(100),
  -- UNIQUE IDENTIFIER OF BUSINESS
  NAME VARCHAR(255),
  -- NAME OF BUSINESS
  REVIEW_COUNT INT,
  -- TOTAL NUMBER OF REVIEWS
  PRIMARY KEY (ID)
);
CREATE TABLE reviews (
  /* Describe your table here.*/
  ID VARCHAR(255),
  -- UNIQUE IDENTIFIER OF REVIEW,
  USER_ID VARCHAR(255),
  -- USER ID ASSOCIATED WITH REVIEW,
  BUSINESS_ID VARCHAR(255),
  -- BUSINESS ID ASSOCIATED WITH REVIEW,
  STARS INT,
  -- STAR RATING,
  REVIEW_DATE VARCHAR(255),
  -- REVIEW DATE,
  REVIEW_TEXT VARCHAR(1000),
  -- REVIEW CONTENT,
  USEFUL INT,
  -- USEFUL VOTES,
  FUNNY INT,
  -- USEFUL VOTES,
  COOL INT,
  -- USEFUL VOTES,
  PRIMARY KEY (ID),
  FOREIGN KEY (USER_ID) 
    REFERENCES users(ID),
  FOREIGN KEY (BUSINESS_ID) 
    REFERENCES businesses(ID)
);
CREATE TABLE photos (
  ID VARCHAR(255),
  -- UNIQUE IDENTIFIER OF PHOTO
  BUSINESS_ID VARCHAR(255),
  -- UNIQUE IDENTIFIER OF ASSOCIATED REVIEW
  USER_ID VARCHAR(255),
  -- UNIQUE IDENTIFIER OF ASSOCIATED USER
  PRIMARY KEY (ID),
  FOREIGN KEY (BUSINESS_ID) 
    REFERENCES businesses(ID),
  FOREIGN KEY (user_id) 
    REFERENCES users(ID)
);
CREATE TABLE messages (
  ID VARCHAR(255),
  -- UNIQUE IDENTIFIER OF MESSAGE
  AUTHOR_ID VARCHAR(255),
  -- USER_ID OF AUTHOR OF MESSAGE
  RECIPIENT_ID VARCHAR(255),
  -- USER_ID OF RECIPIENT OF MESSAGE
  SUBJECT VARCHAR(255),
  -- SUBJECT/TITLE OF MESSAGE
  MESSAGETEXT VARCHAR(1000),
  -- TEXT CONTENT OF MESSAGE
  PRIMARY KEY (ID),
  FOREIGN KEY (AUTHOR_ID)
    REFERENCES users(ID),
  FOREIGN KEY (RECIPIENT_ID)
    REFERENCES users(ID)
);
